import { useEffect, useState } from 'react';
import hielo from '../assets/static/hielo.png';
import naturaleza from '../assets/static/naturaleza.png';
import fuego from '../assets/static/fuego.png';
import oscuro from '../assets/static/oscuro.png';
import sagrado from '../assets/static/sagrado.png';
import { getImgClassHero } from '../localFunction';

const useDataPj = (data) => {
  const [dataPj, setDataPj] = useState({
    starsNode: [],
    srcElement: '',
    srcClassHero: '',
    color: '',
  });
  useEffect(() => {
    let type,
      className,
      color;
    const stars = [];
    for (let i = 0; i < data.stars; i++) {
      stars.push(i);
    }
    type = data.element.toLowerCase();
    className = data.classHero.toLowerCase();
    switch (type) {
      case 'azul hielo':
        type = hielo;
        color = 'blue';
        break;
      case 'violeta oscuro':
        type = oscuro;
        color = 'purple';
        break;
      case 'verde naturaleza':
        type = naturaleza;
        color = 'green';
        break;
      case 'rojo fuego':
        type = fuego;
        color = 'red';
        break;
      case 'amarillo sagrado':
        type = sagrado;
        color = 'yellow';
        break;
      default:
        break;
    }
    className = getImgClassHero(className);
    setDataPj({
      starsNode: stars,
      srcElement: type,
      srcClassHero: className,
      color,
    });
  }, []);
  return { dataPj };
};

export default useDataPj;
